import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
const { v4: uuiV4 } = require("uuid");

const Header = styled.div`
  font-size: 42px;
  height: 50vh;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Content = styled.div`

  margin-right: 40%;
  margin-left: 40%;
  display: flex;
  color: black;
  border-radius: 25px;
  align-itens: center;
  background-color: palevioletred;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 72px;
  color: #fff;
  border: 3px solid black;
`;

const StyledLink = styled(Link)`
  color: #fff;
  font-weight: bold;
  text-decoration: none;
`;

function Home() {
  const id = uuiV4();
  return (
    <div>
      <Header>
        <h1>Video Chat</h1>
      </Header>
      <Content>
        <StyledLink to={`room/${id}`}>Create</StyledLink>
      </Content>
    </div>
  );
}

export default Home;
